import React, { useEffect } from 'react'
import { Link } from 'react-router-dom'
import axios from 'axios'
import { API_URL } from '../utils/constants'
import { empType } from '../types'

export default function Dashboard() {
  useEffect(() => {
    const user = JSON.parse(localStorage.getItem('employee_data') || '')
    if (user) {
      const welcomeMessage = document.getElementById(
        'welcomeMessage'
      ) as HTMLHeadingElement
      welcomeMessage.textContent = `مرحبا بك ${user.full_name} في لوحة التحكم الخاصة بك`
    }

    // Add event listener for beforeunload
    window.addEventListener('beforeunload', handleSignout)

    // Cleanup function to remove the event listener when component unmounts
    return () => {
      window.removeEventListener('beforeunload', handleSignout)
    }
  }, [])

  async function handleSignout() {
    const {
      data: { emp_loggedOut }
    }: { data: { emp_loggedOut: boolean } } = await axios.patch(
      `${API_URL}/employees/logout`,
      {
        employee_id: JSON.parse(localStorage.getItem('employee_data') || '').id
      }
    )
    if (emp_loggedOut) {
      localStorage.removeItem('employee_data')
    }
  }

  const emp_type: empType['role'] =
    JSON.parse(localStorage.getItem('employee_data') || '').role ?? 'employee'

  return (
    <section>
      <div className='dashboard-container'>
        <h2 id='welcomeMessage' dir='rtl'>
          مرحبا بك في لوحة التحكم الخاصة بك
        </h2>
        <p style={{ textAlign: 'center' }}>
          هذه لوحة التحكم الخاصة بك , يمكنك اضافة العمليات هنا
        </p>

        <ul dir='rtl' className='nav-menu'>
          <li>
            <Link to='/customers'>
              <svg
                xmlns='http://www.w3.org/2000/svg'
                width='120'
                height='120'
                viewBox='0 0 24 24'
                fill='none'
                stroke='currentColor'
                strokeWidth='1'
                strokeLinecap='round'
                strokeLinejoin='round'
                className='lucide lucide-users-round'
              >
                <path d='M18 21a8 8 0 0 0-16 0' />
                <circle cx='10' cy='8' r='5' />
                <path d='M22 20c0-3.37-2-6.5-4-8a5 5 0 0 0-.45-8.3' />
              </svg>
              <span>العملاء</span>
            </Link>
          </li>

          {(emp_type === 'admin' || emp_type === 'accountant') && (
            <>
              <li>
                <Link to='/revenues'>
                  <svg
                    xmlns='http://www.w3.org/2000/svg'
                    xmlnsXlink='http://www.w3.org/1999/xlink'
                    width='120'
                    height='120'
                    viewBox='0 0 100 100'
                    fill='none'
                  >
                    <rect width='100' height='100' fill='url(#pattern0_1_2)' />
                    <defs>
                      <pattern
                        id='pattern0_1_2'
                        patternContentUnits='objectBoundingBox'
                        width='1'
                        height='1'
                      >
                        <use xlinkHref='#image0_1_2' transform='scale(0.01)' />
                      </pattern>
                      <image
                        id='image0_1_2'
                        width='100'
                        height='100'
                        xlinkHref='data:image/png;base64,'
                      />
                    </defs>
                  </svg>
                  <span>الايرادات</span>
                </Link>
              </li>

              <li>
                <Link to='/discharges'>
                  <svg
                    xmlns='http://www.w3.org/2000/svg'
                    xmlnsXlink='http://www.w3.org/1999/xlink'
                    width='110'
                    height='110'
                    viewBox='0 0 100 100'
                    fill='none'
                    style={{
                      marginBottom: '10px'
                    }}
                  >
                    <rect width='100' height='100' fill='url(#pattern0_1_4)' />
                    <defs>
                      <pattern
                        id='pattern0_1_4'
                        patternContentUnits='objectBoundingBox'
                        width='1'
                        height='1'
                      >
                        <use xlinkHref='#image0_1_4' transform='scale(0.00195312)' />
                      </pattern>
                      <image
                        id='image0_1_4'
                        width='512'
                        height='512'
                        xlinkHref='data:image/png;base64,'
                      />
                    </defs>
                  </svg>
                  <span>المنصرفات</span>
                </Link>
              </li>
            </>
          )}

          <li>
            <Link to='/invoices'>
              <svg
                xmlns='http://www.w3.org/2000/svg'
                width='120'
                height='120'
                viewBox='0 0 24 24'
                fill='none'
                stroke='currentColor'
                strokeWidth='1'
                strokeLinecap='round'
                strokeLinejoin='round'
                className='lucide lucide-receipt-text'
              >
                <path d='M4 2v20l2-1 2 1 2-1 2 1 2-1 2 1 2-1 2 1V2l-2 1-2-1-2 1-2-1-2 1-2-1Z' />
                <path d='M14 8H8' />
                <path d='M16 12H8' />
                <path d='M13 16H8' />
              </svg>
              <span>الفواتير</span>
            </Link>
          </li>
          <li>
            <Link to='/services?mode=view'>
              <svg
                xmlns='http://www.w3.org/2000/svg'
                width='120'
                height='120'
                viewBox='0 0 24 24'
                fill='none'
                stroke='currentColor'
                strokeWidth='1'
                strokeLinecap='round'
                strokeLinejoin='round'
                className='lucide lucide-list-todo'
              >
                <rect x='3' y='5' width='6' height='6' rx='1' />
                <path d='m3 17 2 2 4-4' />
                <path d='M13 6h8' />
                <path d='M13 12h8' />
                <path d='M13 18h8' />
              </svg>
              <span>الخدمات</span>
            </Link>
          </li>
          {emp_type === 'admin' && (
            <>
              <li>
                <Link to='/add_emp'>
                  <svg
                    xmlns='http://www.w3.org/2000/svg'
                    xmlnsXlink='http://www.w3.org/1999/xlink'
                    width='115'
                    height='115'
                    viewBox='0 0 206 206'
                    fill='none'
                    style={{
                      marginBottom: '5px'
                    }}
                  >
                    <rect width='206' height='206' fill='url(#pattern0_2_2)' />
                    <defs>
                      <pattern
                        id='pattern0_2_2'
                        patternContentUnits='objectBoundingBox'
                        width='1'
                        height='1'
                      >
                        <use xlinkHref='#image0_2_2' transform='scale(0.00195312)' />
                      </pattern>
                      <image
                        id='image0_2_2'
                        width='512'
                        height='512'
                        xlinkHref='data:image/png;base64,'
                      />
                    </defs>
                  </svg>
                  <span>الموظفين</span>
                </Link>
              </li>
              <li>
                <Link to='/attendance'>
                  <svg
                    xmlns='http://www.w3.org/2000/svg'
                    width='120'
                    height='120'
                    viewBox='0 0 24 24'
                    fill='none'
                    stroke='currentColor'
                    strokeWidth='1'
                    strokeLinecap='round'
                    strokeLinejoin='round'
                    className='lucide lucide-calendar-clock'
                  >
                    <path d='M21 7.5V6a2 2 0 0 0-2-2H5a2 2 0 0 0-2 2v14a2 2 0 0 0 2 2h3.5' />
                    <path d='M16 2v4' />
                    <path d='M8 2v4' />
                    <path d='M3 10h5' />
                    <path d='M17.5 17.5 16 16.3V14' />
                    <circle cx='16' cy='16' r='6' />
                  </svg>
                  <span>الحضور والإنصارف</span>
                </Link>
              </li>
              <li>
                <Link to='/office_details'>
                  <svg
                    xmlns='http://www.w3.org/2000/svg'
                    width='120'
                    height='120'
                    viewBox='0 0 24 24'
                    fill='none'
                    stroke='currentColor'
                    strokeWidth='1'
                    strokeLinecap='round'
                    strokeLinejoin='round'
                    className='lucide lucide-landmark'
                  >
                    <line x1='3' x2='21' y1='22' y2='22' />
                    <line x1='6' x2='6' y1='18' y2='11' />
                    <line x1='10' x2='10' y1='18' y2='11' />
                    <line x1='14' x2='14' y1='18' y2='11' />
                    <line x1='18' x2='18' y1='18' y2='11' />
                    <polygon points='12 2 20 7 4 7' />
                  </svg>
                  <span>تفاصيل المكتب</span>
                </Link>
              </li>
            </>
          )}
        </ul>
        <Link to='/login' className='logout-btn' onClick={handleSignout}>
          خروج
        </Link>
      </div>
    </section>
  )
}
